import React, { useState, useEffect } from "react";
import axios from "axios";

const Request = () => {
  const [features, setFeature] = useState([]);

  const fetchRequest = () => {
    const config = {
      method: "get",
      url: `https://services2.arcgis.com/y20RuA5nmE8htWdM/ArcGIS/rest/services/service_565a99c4292149b0ae6b6bd5d9aaebd3/FeatureServer/0/query?where=1%3D1&objectIds=&time=&geometry=&geometryType=esriGeometryEnvelope&inSR=&spatialRel=esriSpatialRelIntersects&resultType=none&distance=0.0&units=esriSRUnit_Meter&relationParam=&returnGeodetic=false&outFields=*&returnGeometry=true&featureEncoding=esriDefault&multipatchOption=xyFootprint&maxAllowableOffset=&geometryPrecision=&outSR=&defaultSR=&datumTransformation=&applyVCSProjection=false&returnIdsOnly=false&returnUniqueIdsOnly=false&returnCountOnly=false&returnExtentOnly=false&returnQueryGeometry=false&returnDistinctValues=false&cacheHint=false&orderByFields=&groupByFieldsForStatistics=&outStatistics=&having=&resultOffset=&resultRecordCount=&returnZ=false&returnM=false&returnExceededLimitFeatures=true&quantizationParameters=&sqlFormat=none&f=pjson&token=O1qWrBeMK82tfQcnSsbT7l66l1cwGBtATDQqMQAeXUmf2zuZ3tfrXNDYoNDXX3x3CgNwKmQEGZbavrmHoITHmFCsk-KbMkYi0Cgol9lkptTyxI2srB-ta5U2-rTV9bX4CfKYQXu9XSr36roQ88exjKqJ289vErOLcbgQST7D-v3ff140XBhWICVWNqAPFiwUxJv29yUbV9UQFiIRhJAsKaGyNB7qvlHyoYUi3Z72Trk.`,
    };
    axios(config)
      .then((response) => {
        setFeature(response.data.features);
        console.log("_________________________");
        console.log(response.data.features);
        console.log("___________________________");
      })
      .catch((error) => {
        console.log(error);
      });
  };
  useEffect(() => {
    fetchRequest();
  }, []);

  return (
    <div style={{ height: "auto" }} className="w-full">
      <div className="flex mb-4 ">
        <div className="w-full bg-gray-200 ">
          <div className="grid w-full grid-cols-5 gap-2 px-2 text-black">
            <div className="flex flex-col items-center w-full  py-3 text-gray-700 bg-white border">
              <p className="text-base">PO</p>
              <div className="flex gap-4 text-7xl font-semibold">
                {/* <GrDocumentText className="text-gray-700" />
                  {entransitStatus +
                    livreClientStatus +
                    livreStatus +
                    enregistreStatus} */}
              </div>
            </div>
            <div className="flex flex-col items-center w-full py-3 text-gray-700 bg-white border">
              <p className="text-base">Request</p>
              <div className="flex gap-4 text-7xl font-semibold">
                {/* <RiStockFill className="text-gray-700" />
                  {enregistreStatus} */}
              </div>
            </div>
            <div className="flex flex-col items-center w-full py-3 text-gray-700 bg-white border">
              <p className="text-base">Delivered/school</p>
              <div className="flex gap-4 text-7xl font-semibold">
                {/* <AiFillCar className="text-gray-700" />
                  {entransitStatus} */}
              </div>
            </div>
            <div className="flex flex-col items-center w-full py-3 text-gray-700 bg-white border">
              <p className="text-base">Distributed/student</p>
              <div className="flex gap-4 text-7xl font-semibold">
                {/* <GiHouse className="text-gray-700" />
                  {livreStatus} */}
              </div>
            </div>
            <div className="flex flex-col items-center w-full py-3 text-gray-700 bg-white border">
              <p className="text-base">Remaining/Pc</p>
              <div className="flex gap-4 text-7xl font-semibold">
                {/* <FaPeopleCarry className="text-gray-700" />
                  {livreClientStatus} */}
              </div>
            </div>
          </div>
          <div
            className="grid grid-cols-3 gap-2 m-1"
            style={{ height: "80vh" }}
          >
            <div className="col-span-1 overflow-scroll">
              <iframe
                title="Dashboard"
                width="100%"
                height="100%"
                allowFullScreen
                src="https://survey123.arcgis.com/share/bc45dd156a764d88bab7fd77d32dda9d?portalUrl=https://esri-rw.maps.arcgis.com"
              ></iframe>
            </div>

            <div className="col-span-2 overflow-scroll">
              <div className="flex items-center justify-end  gap-3 pr-10 pb-5 pt-5">
                <input
                  type="text"
                  id="table-search"
                  // value={searchText}
                  // onChange={(e) => setsearchText(e.target.value)}
                  className="block p-2 pl-10 text-sm text-gray-900 border border-gray-300 rounded-lg w-80 bg-gray-50 focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500"
                  placeholder="Search School"
                />

                {/* <CSVLink filename={`traitement-${new Date().toISOString()}.csv`} className="cursor-pointer" data={
                    features
                      .filter((feature) =>
                        (feature.attributes.numero_colis + "").startsWith(
                          searchText
                        )
                      ).map(f => (
                        { ...f.attributes }
                      ))
                  }>
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      fill="none"
                      viewBox="0 0 24 24"
                      strokeWidth={1.5}
                      stroke="currentColor"
                      className="w-6 h-6"
                    >
                      <path
                        strokeLinecap="round"
                        strokeLinejoin="round"
                        d="M12 9.75v6.75m0 0l-3-3m3 3l3-3m-8.25 6a4.5 4.5 0 01-1.41-8.775 5.25 5.25 0 0110.233-2.33 3 3 0 013.758 3.848A3.752 3.752 0 0118 19.5H6.75z"
                      />
                    </svg>
                  </CSVLink> */}
              </div>
              <table
                id="myTable"
                className="w-full text-sm text-left text-gray-500 dark:text-gray-400"
              >
                <thead className="text-xs text-gray-700 uppercase bg-gray-50 dark:bg-gray-700 dark:text-gray-200">
                  <tr>
                    <th scope="col" className="px-6 py-3">
                      OBJECTID
                    </th>
                    <th scope="col" className="px-6 py-3">
                      Registration Number
                    </th>
                    <th scope="col" className="px-6 py-3">
                      Name
                    </th>
                    <th scope="col" className="px-6 py-3">
                      School
                    </th>
                    <th scope="col" className="px-6 py-3">
                      Major
                    </th>
                    <th scope="col" className="px-6 py-3">
                      Telephone
                    </th>
                    <th scope="col" className="px-6 py-3">
                      Email
                    </th>
                    <th scope="col" className="px-6 py-3">
                      Serial Number
                    </th>
                    <th scope="col" className="px-6 py-3">
                      Date
                    </th>
                    <th scope="col" className="px-6 py-3">
                      Action
                    </th>
                  </tr>
                </thead>
                <tbody>
                  {features.map((feature, index) => (
                    <tr
                      key={index}
                      className="bg-white border-b dark:bg-gray-800 dark:border-gray-700"
                    >
                      <td className="px-6 py-4 px-6 py-4 font-medium text-gray-900 whitespace-nowrap dark:text-white">
                        {feature?.attributes.objectid}
                      </td>

                      <th scope="row" className="px-6 py-4 ">
                        {feature?.attributes.registration_number}
                      </th>
                      <td className="px-6 py-4">
                        {feature?.attributes.student_name}
                      </td>
                      <td className="px-6 py-4">
                        {feature?.attributes.school}
                      </td>
                      <td className="px-6 py-4">
                        {feature?.attributes.faculty}
                      </td>
                      <td className="px-6 py-4">
                        {feature?.attributes.telphone}
                      </td>
                      <td className="px-6 py-4">{feature?.attributes.email}</td>
                      <td className="px-6 py-4">
                        {feature?.attributes.bar_code}
                      </td>
                      <td className="px-6 py-4">
                        {new Date(
                          feature?.attributes.CreationDate
                        ).toLocaleDateString()}
                      </td>
                      <td className="px-6 py-4"></td>
                    </tr>
                  ))}
                </tbody>
              </table>
              {/* <DataTable columns={columns} rows={colins} /> */}
            </div>
          </div>
        </div>
      </div>
    </div>
